import { En_Hero } from "../comps/Portal";
import { chargingForAll } from "../constants";

const NACS = () => {
  return (
    <>
      <En_Hero
        prod={chargingForAll}
        title="Charging for All"
        customLinkLabel="Find Us"
        get="/"
      />
    </>
  );
};

export default NACS;
